button {

.main-frame-blocked button,
.neterror button,

.bad-clock a,
.captive-portal a,

@media (forced-colors: active) {

  .captive-portal a,

  .captive-portal a:focus,
  .lookalike-url a:focus,

}

.captive-portal #primary-button,
.lookalike-url #primary-button,

  font-family: system-ui, sans-serif;
  font-weight: 600;
  outline: none;
}

.bad-clock #primary-button:focus,
.captive-portal #primary-button:focus,
.lookalike-url #primary-button:focus,
.ssl #primary-button:focus {

}

.bad-clock #primary-button:hover,
.captive-portal #primary-button:hover,
.lookalike-url #primary-button:hover,
.ssl #primary-button:hover {
  background-color: var(--edge-blue-hover);

}

.bad-clock #primary-button:active,
.captive-portal #primary-button:active,
.lookalike-url #primary-button:active,

}

@media(forced-colors: active) {

  .lookalike-url #primary-button,

  .bad-clock #primary-button:hover,
  .captive-portal #primary-button:hover,
  .lookalike-url #primary-button:hover,

button:active {

}

}

.interstitial-wrapper {

  font-size: 1em;

}

}

  display: grid;

}

#enhanced-protection-message {
  border-radius: 4px;
  font-size: 1em;
  margin-top: 32px;

}

  display: grid;

}

#enhanced-protection-message div {

#enhanced-protection-message .icon {

}

#https-upgrades-message {

}

.nav-wrapper {
  margin-top: 51px;
}

.nav-wrapper::after {
  clear: both;

  width: 100%;
}

.small-link {
  color: var(--small-link-color);
  font-size: .875em;
}

.checkboxes {
  flex: 0 0 24px;
}

.checkbox {
  --padding: .9em;
  background: transparent;
  display: block;
  height: 1em;
  left: -1em;
  padding-inline-start: var(--padding);
  position: absolute;
  right: 0;
  top: -.5em;
  width: 1em;
}

.checkbox::after {
  border: 1px solid white;
  border-radius: 2px;
  content: '';
  height: 1em;
  left: var(--padding);
  position: absolute;
  top: var(--padding);
  width: 1em;
}

.checkbox::before {
  background: transparent;
  border: 2px solid white;
  border-inline-end-width: 0;
  border-top-width: 0;
  content: '';
  height: .2em;
  left: calc(.3em + var(--padding));
  opacity: 0;
  position: absolute;
  top: calc(.3em  + var(--padding));
  transform: rotate(-45deg);
  width: .5em;
}

input[type=checkbox]:checked ~ .checkbox::before {
  opacity: 1;
}

#recurrent-error-message {
